const text = $input.first().json.output;

// Remove newlines, double asterisks, and triple hashes
const clean_text = text
  .replace(/\n/g, ' ')
  .replace(/\*\*/g, '')
  .replace(/###/g, '');

// Return an array of items
return [
  {
    json: {
      REVIEW_REPORT: clean_text
    }
  }
];

const videos = $input.all().map(item => item.json);

// Sort by published date (latest → oldest)
videos.sort((a, b) => new Date(b.snippet.publishedAt) - new Date(a.snippet.publishedAt));

const latest = videos[0];
const previous = videos[1];

// Helper function to safely get values
const safe = (val) => val !== undefined && val !== null ? val : 0;

// Pull channel stats from another node (HTTP Request1)
const channelStats = $('HTTP Request1').first().json.items[0].statistics;

// Convert strings to numbers for calculations
const totalViewCount = Number(channelStats.viewCount);
const totalVideos = Number(channelStats.videoCount);
const latestViewCount = Number(latest.statistics.viewCount);
const previousViewCount = Number(previous.statistics.viewCount);

// Calculate metrics
const averageViews = totalVideos > 0 ? totalViewCount / totalVideos : 0;

// Helper to format change percentage
function formatChange(latest, previous) {
  if (previous === 0) return "N/A";
  const change = ((latest - previous) / previous) * 100;
  const sign = change >= 0 ? "+" : "-";
  return `${sign}${Math.abs(change).toFixed(2)}%`;
}

// Metrics section
const metrics = {
  "Latest_vs_Previous_Video_Views": `${latestViewCount} views (${formatChange(latestViewCount, previousViewCount)} vs previous)`,
  "Latest_Video_Contribution_to_Channel": `${latestViewCount} views (~${((latestViewCount / totalViewCount) * 100).toFixed(2)}% of total channel views)`,
  "Relative_to_Channel_Average": `${latestViewCount} views (~${((latestViewCount - averageViews)/averageViews*100).toFixed(2)}% ${latestViewCount >= averageViews ? "above" : "below"} channel average)`
};

// Combine latest and previous video details into one object
const combinedVideoData = {
  // Channel stats
  viewCount: safe(channelStats.viewCount),
  subscriberCount: safe(channelStats.subscriberCount),
  videoCount: safe(channelStats.videoCount),

  // Metrics section (before latest video data)
  metrics,

  // Latest video fields
  latest_title: safe(latest.snippet.title),
  latest_description: safe(latest.snippet.description),
  latest_duration: safe(latest.contentDetails.duration),
  latest_publishedAt: safe(latest.snippet.publishedAt),
  latest_likeCount: safe(latest.statistics.likeCount),
  latest_viewCount: safe(latest.statistics.viewCount),
  latest_commentCount: safe(latest.statistics.commentCount),
  latest_favoriteCount: safe(latest.statistics.favoriteCount),
  latest_tags: safe(latest.snippet.tags),

  // Previous video fields
  previous_title: safe(previous.snippet.title),
  previous_description: safe(previous.snippet.description),
  previous_duration: safe(previous.contentDetails.duration),
  previous_publishedAt: safe(previous.snippet.publishedAt),
  previous_likeCount: safe(previous.statistics.likeCount),
  previous_viewCount: safe(previous.statistics.viewCount),
  previous_commentCount: safe(previous.statistics.commentCount),
  previous_favoriteCount: safe(previous.statistics.favoriteCount),
  previous_tags: safe(previous.snippet.tags),
};

// Return as a single JSON object
return [{ json: combinedVideoData }];

// Assuming $input.first().json is the first item in the array with "content"
const firstItem = $input.first().json;

// If the data is wrapped inside TOTAL_INFO, adjust accordingly
const rawContent = firstItem.content || "";

// Clean and normalize
const formattedContent = rawContent
    .replace(/\s+/g, ' ')        // normalize spaces
    .replace(/ \\n /g, '\n')    // fix escaped newlines if any
    .trim();

return [
  {
    json: {
      TOTAL_INFO_CONTENT: formattedContent
    }
  }
];

