  .replace(/###/g, '');

// Safely get the 'From' field
const from = $('Get a message').first().json.From || "";

// Extract only the name using regex
const nameMatch = from.match(/^([^<]+)/);
const name = nameMatch ? nameMatch[1].trim() : "";

// Safely get AI output (subject + full body text)
const data = $input.first().json.output || {};
const key = Object.keys(data)[0];
const fullText = key ? data[key] : "";

// Split into subject and body
let subject = "";
let ai_body = "";

if (fullText) {
  const [subjectLine, ...bodyParts] = fullText.split('\n');
  subject = subjectLine.replace("Subject: ", "").trim();
  ai_body = bodyParts.join('\n').trim().replace(/\n/g, ' '); // ← remove all newlines
}

// Return all data together in proper n8n format
return [
  {
    json: {
      name: name,
      clean_body: clean_text,
      subject: subject,
      ai_body: ai_body
    }
  }
];

